import Navbar from "./components/navbar/Navbar";
import Header from "./components/header/Header";
import CardsPrin from "./components/cardsPrin/Card";
import Footer from "./components/footer/Footer";
import { BrowserRouter , Routes,  Route } from "react-router-dom";

function App() {
	return (
		<div className="App">
			<BrowserRouter>
			<Routes> 
			<Route path="/" element={<></>}/>
				</Routes>
				<Navbar />			
		<Header />	
			<CardsPrin /> 
			<Footer />
			</BrowserRouter>
		</div>
	);
}

export default App;
